import React from 'react';
import styled from 'styled-components';

const StyledVehicleImg = styled.img`
`;

function VehicleImg({ className, id, imageSrc, alt }) {
  return (
    <StyledVehicleImg 
      className={className}
      id={id}
      src={imageSrc}
      alt={alt}
    />
  );
}

export default VehicleImg;
